INSERT INTO `v1_0b0294c996d9a0bcebb64f535bf39cdc49691fbc4d2de478dc4e02aeb389d8c0` VALUES (0, 40011, 1, 325, "クリア", 2, 5, "こんにちは、お兄さん♪\n【アルターメイデン】の\nクリアです", 126001, 2, 24001);
